#include <iostream>
#include <fstream>
using namespace std;

ifstream in("cifre.in");
ofstream out("cifre.out");

int main() {
    long long n, c, ans = 0;
    in >> n >> c;
    for (long long i = 1; i <= n; i++) {
        long long num = i;
        while (num > 0) {
            if (num % 10 == c) ans++;
            num /= 10;
        }
    }
    out << ans << endl;
    return 0;
}
